// JSX Section
import './App.css';
import React from "react";
import { Switch, Route } from 'react-router-dom'
import { MainPage, ApplicationPage, PageNotFound } from './pages'

function App() {
  return (
    <Switch>
      <Route path="/" exact={ true }  component={MainPage}/>
    </Switch>
  );
}

export default App;
